import '../../styles/footer.css'
import Wave from '../../assets/wave.svg'
function Footer() {
  return (
    <footer>
      <div>
        <img src={Wave} alt="">
          {' '}
        </img>
      </div>
    </footer>
  )
}
export default Footer
